import React from "react";

const Canjeables = () => {
  return (
    <div className="canjeables">
      <h1>** 10.000 Puntos **</h1>
      <h2>Ganar puntos</h2>
      <input
        type="file"
        id="avatar"
        name="avatar"
        accept="image/png, image/jpeg"
      ></input>
      <h2>Usar puntos</h2>
    </div>
  );
};

export default Canjeables;
